    while(!result.done){
        console.log(result.value)
        result =itrators.next()
    }
}

iteratorSymbol=(arr)=>{
    let nextNumer=0;
   return {
    next(){
        return{
            value:arr[nextNumer++],
            done:false
        }    

        }
   }
}

anotherIteratorfunction=()=>{
    let number=[100,200,300]
    let iteratiorvalue=this.iteratorSymbol(number)
    console.log(iteratiorvalue.next())
}

